import Head from "next/head";
import Container from "../components/";

const Services = () => {
  return (
    <Container>
      <Head>
        <title>Next.js Project - Services</title>
      </Head>
      <h1>Services</h1>
      <p>
        Lorem ipsum dolor sit amet, consectetur adipisicing elit. Sint quod
        quibusdam saepe asperiores. Possimus, obcaecati repellendus. Assumenda
        consectetur deleniti harum pariatur. Eius quo accusantium earum illum
        quia iste magnam sit.
      </p>
    </Container>
  );
};

export default Services;
